import React from 'react'

const DepenseCard = (props) => {
    const {id, valeur, cause, acteur} = props.depense;
    return (
        <div className="ui bulleted">
            <div class item>
                <h4>{valeur}</h4>
                <p>{cause}</p><br/>
                <p>{acteur}</p>
            </div>
        </div>
    )
}

export default DepenseCard
